    {
      id: 1,
      title: " work :1",
    },
    {
      id: 2,
      title: " work :2",
    },
    {
      id: 2,
      title: " work :2",
    },
  ]);
  const [inputValue, setInputValue]= useState("")

  return (
    <Block>
      <div>
        <input type="text" onChange={(e) => setInputValue(e.target.value)} />
        <button>add property</button>
      </div>
      <div>
        {data.map((value, id) => (
          <div key={id}>
            <h2>
              {value.title}
              <button>delete</button>
            </h2>
          </div>
        ))}
      </div>
    </Block>
  );
};

export default UseRaducer;
